import Home from '../pages/Home';
import PlayerPropsAssists from '../pages/playerPropsAssists';
import H2hSpreadTotal from '../pages/h2hSpreadTotal';
import PlayerPropsRebounds from '../pages/playerPropsRebounds';
import PlayerPropsPoints from '../pages/playerPropsPoints';
import { Box, Flex, Link, Spacer, Button } from '@chakra-ui/react';
import { Routes, Route, Link as RouterLink } from 'react-router-dom';

const App = () => {
  return (
    <Box p={4}>
      {/* Navigation Bar */}
      <Flex as="nav" mb={6} align="center" justify="space-between" bg="teal.800" p={4} borderRadius="md" boxShadow="md">
        <Flex>
          <Link
            as={RouterLink}
            to="/"
            p={3}
            fontSize="lg"
            fontWeight="bold"
            color="white"
            border="2px"
            borderColor="transparent"
            _hover={{
              color: 'teal.800',
              bg: 'white',
              borderColor: 'teal.800',
              transform: 'scale(1.05)',
            }}
            _active={{
              bg: 'teal.700',
              color: 'white',
            }}
            borderRadius="md"
            mr={2}
          >
            Home
          </Link>
          <Link
            as={RouterLink}
            to="/h2h-spread-total"
            p={3}
            fontSize="lg"
            color="white"
            border="2px"
            borderColor="transparent"
            _hover={{
              color: 'orange.800',
              bg: 'white',
              borderColor: 'orange.800',
              transform: 'scale(1.05)',
            }}
            _active={{
              bg: 'orange.700',
              color: 'white',
            }}
            borderRadius="md"
            mr={2}
          >
            H2H - Spreads - Totals
          </Link>
          <Link
            as={RouterLink}
            to="/player-props-assists"
            p={3}
            fontSize="lg"
            color="white"
            border="2px"
            borderColor="transparent"
            _hover={{
              color: 'blue.800',
              bg: 'white',
              borderColor: 'blue.800',
              transform: 'scale(1.05)',
            }}
            _active={{
              bg: 'blue.700',
              color: 'white',
            }}
            borderRadius="md"
            mr={2}
          >
            Player Props - Assists
          </Link>
          <Link
            as={RouterLink}
            to="/player-props-rebounds"
            p={3}
            fontSize="lg"
            color="white"
            border="2px"
            borderColor="transparent"
            _hover={{
              color: 'purple.800',
              bg: 'white',
              borderColor: 'purple.800',
              transform: 'scale(1.05)',
            }}
            _active={{
              bg: 'purple.700',
              color: 'white',
            }}
            borderRadius="md"
            mr={2}
          >
            Player Props - Rebounds
          </Link>
          <Link
            as={RouterLink}
            to="/player-props-points"
            p={3}
            fontSize="lg"
            color="white"
            border="2px"
            borderColor="transparent"
            _hover={{
              color: 'yellow.800',
              bg: 'white',
              borderColor: 'yellow.800',
              transform: 'scale(1.05)',
            }}
            _active={{
              bg: 'yellow.700',
              color: 'white',
            }}
            borderRadius="md"
            mr={2}
          >
            Player Props - Points
          </Link>
        </Flex>
        <Spacer />
        {/* Sign In Button with hover effect */}
        <Button
          colorScheme="teal"
          variant="solid"
          size="sm"
          borderRadius="md"
          _hover={{
            bg: 'teal.600',
            transform: 'scale(1.05)',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
          }}
          _active={{
            bg: 'teal.700',
            transform: 'scale(1.03)',
          }}
        >
          Sign In
        </Button>
      </Flex>

      {/* Routes */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/h2h-spread-total" element={<H2hSpreadTotal />} />
        <Route path="/player-props-assists" element={<PlayerPropsAssists />} />
        <Route path="/player-props-rebounds" element={<PlayerPropsRebounds />} />
        <Route path="/player-props-points" element={<PlayerPropsPoints />} />
      </Routes>
    </Box>
  );
};

export default App;
